import React from 'react';

const styles= {
    tags: {
        color: 'white'
    }
}
const tags = {
    htmlstart: "<html>"
}
const Landing = () => {

    return(

        <>
        <p style={styles.tags}>{tags.htmlstart}</p>
        </>
    )
}
export default Landing
